public class TFTPReadRequestPacketTest1 {

    private DatagramPacket createReadRequestDatagram() throws UnknownHostException {
        String fileName = "test.txt";
        String mode = "octet";
        String blksize = "blksize";
        String blksizeValue = "1024";

        // Manually construct the byte array for the request
        // Opcode (2) + filename + 0 + mode + 0 + blksize + 0 + blksizeValue + 0
        byte[] fileNameBytes = fileName.getBytes(StandardCharsets.US_ASCII);
        byte[] modeBytes = mode.getBytes(StandardCharsets.US_ASCII);
        byte[] blksizeBytes = blksize.getBytes(StandardCharsets.US_ASCII);
        byte[] blksizeValueBytes = blksizeValue.getBytes(StandardCharsets.US_ASCII);

        int len = 2 + fileNameBytes.length + 1 + modeBytes.length + 1 + blksizeBytes.length + 1 + blksizeValueBytes.length + 1;
        byte[] data = new byte[len];

        int offset = 0;
        // Opcode
        data[offset++] = 0;
        data[offset++] = (byte) TFTPPacket.READ_REQUEST;

        // Filename
        System.arraycopy(fileNameBytes, 0, data, offset, fileNameBytes.length);
        offset += fileNameBytes.length;
        data[offset++] = 0;

        // Mode
        System.arraycopy(modeBytes, 0, data, offset, modeBytes.length);
        offset += modeBytes.length;
        data[offset++] = 0;

        // Option: blksize
        System.arraycopy(blksizeBytes, 0, data, offset, blksizeBytes.length);
        offset += blksizeBytes.length;
        data[offset++] = 0;

        // Option value: 1024
        System.arraycopy(blksizeValueBytes, 0, data, offset, blksizeValueBytes.length);
        offset += blksizeValueBytes.length;
        data[offset++] = 0;

        return new DatagramPacket(data, len, InetAddress.getLocalHost(), 12345);
    }

    @Test
    public void testNewDatagramReconstruction() throws Exception {
        DatagramPacket originalDatagram = createReadRequestDatagram();

        // 1. Create a TFTPReadRequestPacket by parsing the original datagram
        TFTPReadRequestPacket requestPacket = new TFTPReadRequestPacket(originalDatagram);

        // 2. Test the parameterless newDatagram() method
        DatagramPacket reconstructedDatagram1 = requestPacket.newDatagram();

        assertNotNull(reconstructedDatagram1, "The reconstructed datagram should not be null.");
        assertEquals(originalDatagram.getAddress(), reconstructedDatagram1.getAddress(), "Addresses should match.");
        assertEquals(originalDatagram.getPort(), reconstructedDatagram1.getPort(), "Ports should match.");
        assertEquals(originalDatagram.getLength(), reconstructedDatagram1.getLength(), "Lengths should match.");

        byte[] originalData = java.util.Arrays.copyOf(originalDatagram.getData(), originalDatagram.getLength());
        byte[] reconstructedData1 = java.util.Arrays.copyOf(reconstructedDatagram1.getData(), reconstructedDatagram1.getLength());
        assertArrayEquals(originalData, reconstructedData1, "Byte data should match for parameterless reconstruction.");

        // 3. Test the two-parameter newDatagram(DatagramPacket, byte[]) method
        byte[] buffer = new byte[originalDatagram.getLength()];
        DatagramPacket targetDatagram = new DatagramPacket(buffer, buffer.length, InetAddress.getLocalHost(), 54321);

        requestPacket.newDatagram(targetDatagram, buffer);

        assertEquals(originalDatagram.getAddress(), targetDatagram.getAddress(), "Addresses should match for two-parameter reconstruction.");
        assertEquals(originalDatagram.getPort(), targetDatagram.getPort(), "Ports should match for two-parameter reconstruction.");
        // The newDatagram method populates the provided buffer
        assertArrayEquals(originalData, buffer, "Byte data in the provided buffer should match the original datagram's data.");
    }
}

