package org.apache.commons.net.tftp;

import org.junit.jupiter.api.Test;

import java.net.DatagramPacket;
import java.net.InetAddress;
import java.net.UnknownHostException;
import java.util.Arrays;

import static org.junit.jupiter.api.Assertions.assertArrayEquals;
import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertNotNull;

public class TFTPRequestPacketTest1 {

    @Test
    public void testNewDatagram() throws UnknownHostException {
        // Test data
        final String resourceName = "test-file.txt";
        final int transferMode = TFTP.OCTET_MODE;
        final InetAddress localAddress = InetAddress.getLocalHost();
        final int port = 12345;

        // 1. Create the request
        final TFTPReadRequestPacket requestPacket = new TFTPReadRequestPacket(localAddress, port, resourceName, transferMode);

        // 2. First reproduction scenario: generate a new packet
        final DatagramPacket newPacket = requestPacket.newDatagram();

        // 3. Verify new packet
        assertNotNull(newPacket, "The newly created packet should not be null.");
        assertEquals(localAddress, newPacket.getAddress(), "The destination address should be identical.");
        assertEquals(port, newPacket.getPort(), "The communication port should be identical.");

        // Manually create expected data for comparison
        final byte[] expectedData = new byte[resourceName.length() + TFTP.getModeName(transferMode).length() + 4];
        int dataLength = 0;
        expectedData[dataLength++] = 0;
        expectedData[dataLength++] = (byte) TFTPPacket.READ_REQUEST;
        System.arraycopy(resourceName.getBytes(), 0, expectedData, dataLength, resourceName.length());
        dataLength += resourceName.length();
        expectedData[dataLength++] = 0;
        System.arraycopy(TFTP.getModeName(transferMode).getBytes(), 0, expectedData, dataLength, TFTP.getModeName(transferMode).length());
        dataLength += TFTP.getModeName(transferMode).length();
        expectedData[dataLength++] = 0;

        assertEquals(dataLength, newPacket.getLength(), "The packet size should match the original specification.");
        assertArrayEquals(expectedData, Arrays.copyOf(newPacket.getData(), newPacket.getLength()), "The message content should be unchanged byte-for-byte.");

        // 4. Second reproduction scenario: populate an existing packet
        final byte[] buffer = new byte[dataLength];
        final DatagramPacket preparedPacket = new DatagramPacket(buffer, buffer.length, localAddress, port);
        requestPacket.newDatagram(preparedPacket);

        // 5. Verify populated packet
        assertEquals(localAddress, preparedPacket.getAddress(), "The reproduced packet should retain the correct destination address.");
        assertEquals(port, preparedPacket.getPort(), "The reproduced packet should retain the correct port information.");
        assertEquals(dataLength, preparedPacket.getLength(), "The packet size should match the original specification.");
        assertArrayEquals(expectedData, Arrays.copyOf(preparedPacket.getData(), preparedPacket.getLength()), "The populated buffer should contain an exact copy of the original message content.");
    }
}

